import React, { useState } from 'react';
import { withRouter } from "react-router";





const Auth = ()=>{
  
    const [Register, setRegister] = useState()
    const [value, setValue] = useState({
        email: '',
        password: ''
      })


    const inputValue = (event) =>{
        const {name, value} = event.target
        setValue((prevData) =>{
          return {...prevData,
            [name] : value}
        })
        
    }


    const Onsubmit = () =>{
      window.location.reload()
      
      try{ fetch('http://localhost:8000/auth/login', {
        method : 'POST',
        headers : {
          "Accept" : 'application/json',
          "Content-Type" : 'application/json'
        },
        body : 
         JSON.stringify(value)
       })
       .then(response => response.json()).then((result) => {
        
       {  typeof result.access_token !== 'undefined' && result.access_token !== null ? localStorage.setItem("auth",JSON.stringify(result.access_token)) : console.log('null') }
         
          
         
       })
       
      }
      catch (error) {
        console.log(error)
      }
     
    }
    return(
        <>
        {Register ?
         <div>
         <input type='text' onChange = {inputValue} value = {value.email} name = "email"></input> <br/>
         <input type='password' onChange = {inputValue} value = {value.password} name = 'password'></input><br/>
        <button onClick = {Onsubmit}>Login</button> 
        <button onClick = {() => setRegister ({Register : true})}>Register</button> 
        </div>
        :
        <div>
        <input type='text' onChange = {inputValue} value = {value.email} name = "email"></input> <br/>
        <input type='password' onChange = {inputValue} value = {value.password} name = 'password'></input><br/>
        <input type='password' onChange = {inputValue} value = {value.password} name = 'c_password' placeholder = "Confirm password"></input><br/>
       <button onClick = {Onsubmit}>Register</button> 
       <button onClick = {() => setRegister ({Register : false})}>Login</button> 
       </div>
         }
       

       
        </>
    )
}


export default withRouter(Auth)
